INSERT INTO `news` (`news_id`, `news_title`, `news_text`, `news_time`, `new`) VALUES
(4, 'Старт проекта', 'Приветствую Вас, фермеры!\r\nСегодня запускается экономическая игра Mega-Ogorod.com\r\nЖелаем всем интересного времяпровождения и больших заработков!\r\n\r\nС уважением, Администрация.', 1439494579, 0),
(5, 'Сбой', 'Уважаемые пользователи, произошел сбой на сервере, в связи с этим сайт был не доступен в течении суток. На данный момент ситуация нормализовалась. Мы перенесли сайт на более мощный сервер, извиняемся за предоставленные неудобства.\r\n\r\nС уважением, Администрация. ', 1439700941, 0),
(6, 'Конкурсы', 'Приветствую Вас, фермеры!\r\n\r\nЗапускаем конкурс инвесторов и рефералов, подробнее о сроках и призах смотрите в разделе конкурсы.\r\n\r\nС уважением, Администрация.', 1439999891, 1);
INSERT INTO `pages` (`page_id`, `page_text`) VALUES
(1, '<h1>Контакты</h1>\r\nЕсли у Вас, возникли технические проблемы с игрой (такие, как: авторизация, неправильное отображение страниц, проблемы с зачислением игровых валют, то обратитесь в нашу тех. поддержку по данным вопросам:\r\n\r\n<strong>E-mail: </strong>support@farmania.tk\r\n\r\n\r\n');
